import React from "react";
import MiniNav from "./MiniNav";
//import Main from "./Main";
const Navbar = () => {
  return (
    <div>
      <nav className="navbar navbar-light bg-light">
      <button className="navbar-brand">Button Text</button>

          <img
            src="https://1.bp.blogspot.com/-iNjPFmg17jM/XcsN0KcmO3I/AAAAAAAAdHA/jkFo0C47MWMiNJui3CGjifcnrLUSyl11QCNcBGAsYHQ/s1600/Blood%2BBank.jpg"
            width="120"
            height="60"
            className="d-inline-block align-top"
            alt=""
          />
          Blood-Bank-App
        
      </nav>
      <MiniNav/>
  
    </div>

  );
};

export default Navbar;
